import React, { useEffect, useState } from "react";

function Home() {
  const [locations, setLocations] = useState([]);
  console.log(locations);
  useEffect(() => {
    fetch("/locations.json")
      .then((response) => {
        response.json();
      })

      .then((data) => {
        setLocations(data);
      });
  }, []);

  return (
    <div className="body-home">
      <div className="image-home">
<img src="../Images/" alt="" />
      </div>
      <h>Chez vous, partout et ailleur</h>
    </div>
  );
}

export default Home;
